import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import 'chartjs-adapter-date-fns';
import { supabase } from '../../supabaseClient';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

// Utility functions
const calculateIndoorReduction = (value) => {
  return value * 0.7; // 30% reduction for indoor air quality
};

const calculateAirPurifierReduction = (value) => {
  return value * 0.6; // 40% reduction
};

const calculateCombinedReduction = (value) => {
  return value * 0.5; // 50% reduction
};

const aggregateDataByDay = (data) => {
  const aggregated = {};

  data.forEach(item => {
    const date = new Date(item.date);
    const dateKey = date.toISOString().split('T')[0];

    if (!aggregated[dateKey]) {
      aggregated[dateKey] = {
        sum: 0,
        count: 0,
        date: date
      };
    }

    if (item['PM 10']) {
      aggregated[dateKey].sum += item['PM 10'];
      aggregated[dateKey].count += 1;
    }
  });

  return Object.values(aggregated).map(item => ({
    date: item.date,
    'PM 10': item.count > 0 ? item.sum / item.count : null
  }));
};

const DatasetToggle = ({ name, isActive, onToggle, color }) => (
  <div style={{ display: 'flex', alignItems: 'center', margin: '5px 0' }}>
    <button
      onClick={() => onToggle(name)}
      style={{
        width: '20px',
        height: '20px',
        borderRadius: '50%',
        border: `2px solid ${color}`,
        backgroundColor: isActive ? color : 'white',
        cursor: 'pointer',
        marginRight: '8px',
        padding: 0
      }}
    />
    <span style={{ fontSize: '0.9rem' }}>{name}</span>
  </div>
);

const PM10Chart = ({ data, userPreferences }) => {
  const [chartData, setChartData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeDatasets, setActiveDatasets] = useState({
    'Outdoor': true,
    'Indoor': true
  });
  const [showEcologica, setShowEcologica] = useState(userPreferences?.hasEcologica || false);

  const toggleDataset = (name) => {
    setActiveDatasets(prev => ({
      ...prev,
      [name]: !prev[name]
    }));
  };

  useEffect(() => {
    try {
      if (!data || data.length === 0) {
        setError('No data available');
        setIsLoading(false);
        return;
      }

      // Aggregate the data by day
      const aggregatedData = aggregateDataByDay(data);

      const formattedData = {
        labels: aggregatedData.map(item => new Date(item.date)),
        datasets: [
          {
            label: 'Outdoor',
            data: aggregatedData.map(item => ({
              x: new Date(item.date),
              y: item['PM 10']
            })),
            borderColor: 'rgb(0, 100, 0)',
            backgroundColor: 'rgba(0, 100, 0, 0.1)',
            borderWidth: 2,
            tension: 0.1
          },
          {
            label: 'Indoor',
            data: aggregatedData.map(item => ({
              x: new Date(item.date),
              y: item['PM 10'] ? calculateIndoorReduction(item['PM 10']) : null
            })),
            borderColor: 'rgb(144, 238, 144)',
            backgroundColor: 'rgba(144, 238, 144, 0.1)',
            borderWidth: 2,
            tension: 0.1
          }
        ]
      };

      if (showEcologica) {
        formattedData.datasets.push({
          label: 'With Air Purifier',
          data: aggregatedData.map(item => ({
            x: new Date(item.date),
            y: item['PM 10'] ? calculateCombinedReduction(item['PM 10']) : null
          })),
          borderColor: 'rgb(100, 149, 237)',
          backgroundColor: 'rgba(100, 149, 237, 0.1)',
          borderWidth: 2,
          tension: 0.1
        });
      }

      setChartData(formattedData);
      setIsLoading(false);
    } catch (err) {
      console.error('Error processing PM10 data:', err);
      setError('Failed to process PM10 data');
      setIsLoading(false);
    }
  }, [data, showEcologica]);

  if (isLoading) return <div>Loading PM10 data...</div>;
  if (error) return <div>Error: {error}</div>;
  if (!chartData || !data.length) return <div>No PM10 data available</div>;

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: {
        type: 'time',
        time: {
          unit: 'day',
          displayFormats: {
            day: 'MMM d'
          }
        },
        title: {
          display: true,
          text: 'Date'
        }
      },
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'μg/m³'
        }
      }
    },
    plugins: {
      legend: {
        display: true,
        position: 'bottom'
      },
      tooltip: {
        mode: 'index',
        intersect: false
      }
    }
  };

  return (
    <div className="content-wrapper">
      <div className="chart-side">
        <div style={{ height: '400px', width: '100%' }}>
          <Line data={chartData} options={options} />
        </div>
        <div style={{ 
          marginTop: '20px',
          display: 'flex',
          gap: '20px',
          justifyContent: 'center'
        }}>
          <DatasetToggle 
            name="Outdoor" 
            isActive={activeDatasets['Outdoor']} 
            onToggle={toggleDataset}
            color="rgba(0, 100, 0, 0.8)"
          />
          <DatasetToggle 
            name="Indoor" 
            isActive={activeDatasets['Indoor']} 
            onToggle={toggleDataset}
            color="rgba(144, 238, 144, 0.8)"
          />
          {userPreferences?.hasEcologica && (
            <DatasetToggle 
              name="With Air Purifier" 
              isActive={showEcologica} 
              onToggle={() => setShowEcologica(!showEcologica)}
              color="rgba(100, 149, 237, 0.8)"
            />
          )}
        </div>
      </div>
    </div>
  );
};

export default PM10Chart;
